webpackJsonp([45180212580614],{1259:function(e,a){e.exports={data:{markdownRemark:{html:'<p>I didn’t spend nearly as long as I should have liked to on my GDS Challenge this week, between my volunteer project and other things. But I think I have a good feel for where it’s going.</p>\n<figure>\n  <img src="/travellydemo-0278ab41099a079528225c8119d72def.gif" alt="Travelly course demo functionality">\n</figure>\n<h2>Look and Feel</h2>\n<p>I’m channeling London Underground and subway maps in general for this challenge. Right now, my color palette is a little more neon than London’s but I like how hip the bright colors feel.</p>\n<h2>Menu</h2>\n<p>I was greatly inspired by <a href="https://community.articulate.com/articles/navigation-menus-elearning">Tim Slade’s Trivia Adventure</a> and the way he used a map as central navigation. I think that conceit will work well in this course.</p>\n<h2>Challenges</h2>\n<p>I’ve mapped out (pun totally intended) 4 interactive challenges: locating top London attractions, identifying the best ways to get around London, noting where Travelly hosts are in London, and a final challenge of putting it all together. Allen Interactions’ Expedia demo was a huge inspiration here. I want to make sure that the course focuses on practicing important skills and, at least in the later challenges, on intrinsic feedback.</p>',frontmatter:{date:"May 11, 2015",path:"/blog/travel-ly-in-progress",title:"Travel.ly In Progress",tags:["map","subway","travel","tube","underground"],categories:["Design","elearning","GDS Challenge"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.8976377952755905,src:"/static/Travelly_featured-c19524e63d6476bbc00ab0fcbdfc146a-41cae.png",srcSet:"/static/Travelly_featured-c19524e63d6476bbc00ab0fcbdfc146a-d0ce1.png 203w,\n/static/Travelly_featured-c19524e63d6476bbc00ab0fcbdfc146a-ef2bb.png 405w,\n/static/Travelly_featured-c19524e63d6476bbc00ab0fcbdfc146a-41cae.png 723w",sizes:"(max-width: 723px) 100vw, 723px"}}}}}},pathContext:{}}}});
